import React from 'react'

export default function Registration() {
  return (
    <div className='flex justify-center items-center min-h-[100vh]'>
        <form className=''>
            <input type='text' placeholder='Email' />
            <input type='password' placeholder='Passwrod'/>
            <input type='submit' />
        </form>
    </div>
  )
}
